

const restaurants = [
    {
        name: "Verduras top 1",
        cuisine: "Brócolis, couve-flor, espinafre, rúcula...",
        image: "data:image/jpeg;base64,"
    },
    {
        name: "Grãos",
        cuisine: " Arroz, aveia, centeio, cevada, milho, soja, trigo...",
        image: "data:image/jpeg;base64,"
    },
   {
        name: "Frutas",
        cuisine: "Tomates, maçãs...",
        image: "data:image/jpeg;base64,"
    },
   {
        name: "Verduras",
        cuisine: "Alface, repolho, couve...",
        image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSE2K5fgcE5g_DB2MidDTYYDo6_QGL4PZkYvA&usqp=CAU"
    },
    // ...
];

document.addEventListener('DOMContentLoaded', () => {
    const restaurantList = document.getElementById('restaurant-list');
    

    // Preenchendo os cards de restaurante
    restaurants.forEach((restaurant) => {
        const card = document.createElement('div');
        card.classList.add('restaurant-card');
        card.innerHTML = `
            <img src="${restaurant.image}" alt="${restaurant.name}">
            <h2>${restaurant.name}</h2>
            <p>${restaurant.cuisine}</p>
            <button>Ver Cardápio</button>
        `;
        restaurantList.appendChild(card);
    });
});


